body:
We use the CUDA binary. The following code shows how we create the `Ort::Session`
```cpp
  auto memory_info =
    Ort::MemoryInfo::CreateCpu(OrtDeviceAllocator, OrtMemTypeCPU);

  environment_ = std::make_unique<Ort::Env>(ORT_LOGGING_LEVEL_FATAL);
  Ort::SessionOptions options;
  options.SetGraphOptimizationLevel(GraphOptimizationLevel::ORT_ENABLE_ALL);
  OrtSessionOptionsAppendExecutionProvider_CUDA(options, 0);
  session_ = std::make_unique<Ort::Session>(*environment_, onnx_model, model_size, options);
```
